import React from "react";
import Layout from "./Layout";
import Signin from "./Signin";
function Home() {
  return (
    <div>
      <Layout />
      <div className="row mt-4">
        <div className="col-md-6 custom-homepage-backgroundImage">
          {" "}
          <div style={{ marginTop: "10px" }}>
            <h1
              className="float-right"
              style={{
                color: "#fffcdc",
                fontWeight: "bold",
                marginTop: "20px",
              }}
            >
              THE ADVENTURE YOU HAVE{" "}
            </h1>{" "}
          </div>
        </div>
        <div className="col-md-6">
          {" "}
          <Signin />{" "}
        </div>
      </div>
      <div className="row" style={{ backgroundColor: "#d9a7c7" }}>
        <div className="col-md-4 my-auto">
          <h1
            className="text-center"
            style={{ color: "#fffcdc", fontWeight: "bold" }}
          >
            THE ADVENTURE YOU HAVE{" "}
          </h1>
        </div>
        <div className="col-md-6 custom-homepage-backgroundImage-2"></div>
        <div className="col-md-2">
          <h1 style={{ color: "EDF5E1" }}> </h1>
        </div>
      </div>
      <div className="row" style={{ backgroundColor: "#7395ae" }}>
        <div className="col-md-3 custom-homepage-backgroundImage-3"></div>
        <div className="col-md-3"></div>
        <div className="col-md-3 custom-homepage-backgroundImage-4"></div>
        <div className="col-md-3"></div>
      </div>
    </div>
  );
}

export default Home;
